import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './header.css';
import '@fortawesome/free-solid-svg-icons'
import { useNavigate} from "react-router-dom";



const Header = () => {
    const navigate = useNavigate();
    return (
        <>
        <div class="flex pt-4 pb-4  w-[100%] ml-auto mr-auto custom-background fixed z-10">
            <div class="sm:flex global">
                <span class="text" onClick={() => navigate("/")}>Where in the world?</span>
            </div>
        </div>
        </>

    )
}

export default Header;
